webpackJsonp([0x63bd6ca29068],{478:function(a,t){a.exports={data:{allMarkdownRemark:{totalCount:1,edges:[{node:{fields:{slug:"/алкотрип-в-абхазию"},excerpt:'<div class="tg-timestamp">10:51</div>Всем привет, нас Вова из @UrbanRuTrip не пустил в свой канал, да и хуй с ним. Нам ничего не смогло помешать завести свой.  Завтра мы стартуем из Ульяновска в Казань, а оттуда в Сочи, а оттуда в Абхазию. Едем мы, честно говоря, пожрать, выпить, пребывать в режиме бесполезной мрази. Ну и посетить пару-тройку достопримечательностей, может быть сгоняем в соседние города. Мы не рассчитываем на дохуя подписчиков, т.к. мы опять воспринимаем канал как записную книжку и облачное хранилище фоток.  Сначала я хотела запилить лонгрид с всяким полезным по итогам, потом вспомнила, что нихуя не запоминаю, если сразу это не записываю, так что буду писать сюда, а потом мож выкачу текст с выжимкой. Зачем? Затем что я очень заебалась гуглить про Абхазию, никто не пишет ничего полезного, все высирают 9000 фоток, сопровождая это всё текстами в духе «Охуенно-заебись, всё очень вкусно, вот фотка монастыря, а вот кусок текста из вики». +Охулиард рассказов, как же там всё хуёво, нет сервиса и так далее. Опять же с нулём конкретики. Ну, охуеть теперь. В общем, надеюсь в итоге написать полезных рекомендаций.  Постить будем примерно в таком же формате, как в УрбанТрипе. Оставайтесь на связи. ',timeToRead:24,frontmatter:{title:"Алкотрип в Абхазию",tags:["Абхазия"],cover:"http://v-georgia.com/wp-content/uploads/2017/09/shutterstock_1480655391-1920x12801500.jpg",date:"2018-06-13",author:"alcopanda"}}}]},allAuthorsJson:{edges:[{node:{id:"alcopanda",name:"Маша Милованова",image:"https://hb.bizmrg.com/urbantrip/media/avatars/alcopanda.jpg",url:"http://gatsbyjs.org/",bio:"Маша. @zhptrs @fokincookin",location:"Ульяновск",socialUrls:null}}]}},pathContext:{author:"alcopanda"}}}});
